 opacity: 0.8,
 color: "#666"
}
// color: "#415FFF"

const cardHover={
  scale: 1.1,
  boxShadow: "0px 0px 12px 0px rgba(65, 95, 255, 0.6)",
  fontWeight: 'bold',
  color: "#415fff",
  opacity: 1
}

const  List = () => {
    return ( 
        <div>
        <div className="List">


   <motion.div whileHover={cardHover} style={card} ><p style={{paddingTop:40}}>滑动对位</p></motion.div>
